import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-red-500">
      <div className="flex container items-center mx-auto">
        <div>
          <h1 className="text-white">Cinemadine</h1>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
